import { ReactComponent } from "*.svg";

import React from 'react'
import {Marker} from 'react-leaflet'
import Icon from '../assets/icon.svg'

const Markers = ()=> {
    return (
        <Marker position = {{lat: '4.08', lng: '-76.19'}} icon={Icon}/>
    )
}

export default Markers
